import './Criteria.css';
import React from "react";
import Selector from "../Selector/Selector.component";

const Criteria = () => {
  return (
    <div className="criteria-div">
      <Selector />
      <div className="criteria-div-header">
        <h2 className="criteria-title">Criteria</h2>
        <span className="criteria-subtitle">Enrollment Criteria is available for East China students during the Fall 2021 Hopkins Global Semester.</span>
      </div>
    </div>
  );
}

export default Criteria;
